const mongoose = require('mongoose');

const dataArray = new mongoose.Schema({
    datapoints: []
})

const dataSchema = new mongoose.Schema({
    dataArray: {
        group: String,
        NPU: String,
        maxEntries: Number,
        usedEntries: Number,
        percentUsage: Number,
        color: String
    }
})

dataSchema.methods.getGroup = function() {
    console.log(this.group);
}
dataSchema.methods.getNPU = function() {
    return this.NPU;
}
dataSchema.methods.getMaxEntries = function() {
    return this.maxEntries;
}
dataSchema.methods.getUsedEntries = function() {
    return this.usedEntries;
}
dataSchema.methods.getPercentUsage = function() {
    return this.percentUsage;
}
dataSchema.methods.getColor = function() {
    return this.color;
}

module.exports = mongoose.model('Data', dataSchema);
